import React from "react";
import "./Task.css";
const Task = (props) => {
  return (

    <tr className={props.className}>

      <td><input type="checkbox"></input>{props.id}</td>
      <td>{props.projectName}</td>
      <td>{props.taskName}</td>
      <td>{props.status}</td>
    </tr>
  );
};

export default Task;
